def duplicate_characters(string):
    seen = set()
    output = []
    for char in string:
        if char in seen:
            output.append(char)
            seen.add(char)
    return ', '.join(output)

def duplicate_characters(string):
    seen = set()
    output = []
    for char in string:
        if char not in seen:
            output.append(char)
            seen.add(char)
    return ''.join(output)
